webpackJsonp([0xbf19192b9dd6],{4923:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Bleib Gesund!",date:"25 Dec 2006",slug:"/2006-12-25-bleib-gesund/",tags:"Y2006"},html:'<p><a href="http://www.flickr.com/photos/papascott/332744642/" title="Photo Sharing"><img src="http://farm1.static.flickr.com/128/332744642_f3a52f2ca6.jpg" width="500" height="361" alt="bleibgesund" /></a></p>\n<p>Christopher drew this card for Santa (known in Germany as *Der Weihnachtsmann*): "Christopher wishes that you stay healthy". That wish applies from us to all our readers as well.</p>'},next:{fields:{title:"Dress Rehearsal",date:"23 Dec 2006",slug:"/2006-12-23-dress-rehearsal/"}},previous:{fields:{title:"Fourth Holiday",date:"27 Dec 2006",slug:"/2006-12-27-fourth-holiday/"}}},{node:{fields:{title:"Dress Rehearsal",date:"23 Dec 2006",slug:"/2006-12-23-dress-rehearsal/",tags:"Y2006"},html:'<p><a href="http://www.flickr.com/photos/papascott/330859523/" title="Photo Sharing"><img src="https://farm1.static.flickr.com/151/330859523_f02e956099.jpg" width="500" height="375" alt="IMG 1862" /></a></p>\n<p>Christopher is ready for the dress rehearsal of our <a href="http://www.papascott.de/archives/2006/12/12/could-those-be-angels/">church Christmas program</a>.</p>'},next:{fields:{title:"Google Reader",date:"22 Dec 2006",slug:"/2006-12-22-google-reader/"}},previous:{fields:{title:"Bleib Gesund!",date:"25 Dec 2006",slug:"/2006-12-25-bleib-gesund/"}}},{node:{fields:{title:"Google Reader",date:"22 Dec 2006",slug:"/2006-12-22-google-reader/",tags:"Y2006"},html:'<p>I never really mentioned it here, but after a long time of reading blogs in <a href="http://www.blogslines.com/">Bloglines</a>, a couple of months ago I tried out <a href="http://www.google.com/reader/">Google Reader</a> and never went back. I\'ve now started <a href="http://www.google.com/reader/shared/15603694783728674282">a link blog</a> using Google Reader\'s \'shared link\' feature (the latest links are in the sidebar here on PapaScott, and there\'s even a <a href="http://www.google.com/reader/public/atom/user/15603694783728674282/state/com.google/broadcast">feed</a>).</p>\n<p>At any rate, if there was anything Google didn\'t know about me before, they certainly know it now. I just have to set up <a href="http://www.google.com/a/">Google Aps for My Domain</a> and their control over me is complete.</p>'},next:{fields:{title:"Christmas Chickens",date:"22 Dec 2006",slug:"/2006-12-22-christmas-chickens/"}},previous:{fields:{title:"Dress Rehearsal",date:"23 Dec 2006",slug:"/2006-12-23-dress-rehearsal/"}}}],pathPrefix:"",first:!1,last:!1,index:168,pageCount:1101}}}});
